import "./home.css"

export default function Home() {
  const [post, setPost] = useState([]);

  useEffect(() => {
   const fetchPosts = async () => {
    const res = await axios.get("/posts")
    setPost(res.data)
   }
   fetchPosts();
  },[])
  return (
    <>
      <Header />
      <div className="home">
          <Posts posts={posts}/>
          <SideBar />
      </div>
    </>
  );
}
